script: |
  super -f text -I q4273.spq | sort > q4273.out

inputs:
  - name: q4273.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE - col0 / - col1 * - col0 * - + 72 NOT IN ( - 33, + col0, + 49 + + + col0 );
  - name: tab2

outputs:
  - name: q4273.out
    data: |
      46	51	23
      64	77	40
      75	67	58
